import styled from 'styled-components';

const Title1 = styled.h1`
font-family:'Garamond'
    box-sizing: border-box;
    color: ${props => (props.color ? props.color : '#fff')};
    font-size: 28px;
    margin: 0px;
    padding: 0px;
`;

export default Title1;
